import React, {Component} from "react"

function AllShows(props){
    const shows = props.comedian.events
    console.log("all shows", shows)
    return(
        <>
            <h1>This Comedian's Shows</h1>
           {shows.map(show => <p>{show.venue}</p>)} 
        </>
    )
}

export default AllShows
